# <editor-fold desc="Config Functionality">
class Ini:
	temp_files = []
	
	# <editor-fold desc="Helper Functions">
	@staticmethod
	def _unify(string):
		string = string.replace("\n", "")
		if string.startswith("#"):
			return "#" + string[1:].lstrip().rstrip()
		elif "=" in string:
			return "=".join([a.lstrip().rstrip() for a in string.split("=")])
	
	@staticmethod
	def _resolve(_path):
		if sys.platform == "win32":
			if len(_path) > 255:
				if not path.startswith("\\\\?\\"):
					_path = "\\\\?\\" + _path
			return _path
		else:
			return _path
		
	def _delete_temp_files(self):
		for file in self.temp_files:
			os.unlink(file)
			self.temp_files.remove(file)
			
	# </editor-fold>
	
	#.ini checks included
	def create_file(self, name = None, mode = "r+", safe = True):
		if name is None:
			name = str(uuid.uuid1()).replace("-", "") + ".ini"
			self.temp_files.append(os.path.join(self.main_path, name))
		elif not name.endswith(".ini"):
			name += ".ini"
		
		_path = os.path.join(self.main_path, name)
		if safe:
			if not(os.path.exists(_path) and os.path.isfile(_path)):
				open(_path, "w+").close()
			return open(_path, mode)
		else:
			open(_path, "w+").close()
			return open(_path, mode)
		
	def read(self, key):
		with open(self.main_config, "r") as f:
			for line in f:
				if line.startswith("#"):
					continue
				line = self._unify(line)
				if key in line:
					if line.split("=")[0] == key:
						return line.split("=")[1]
			return None
		
	def read_flag(self, flag: str):
		if flag.startswith("#"):
			flag = flag.lstrip("#")
		with open(self.main_config, "r") as f:
			for line in f:
				if self._unify(line) == flag:
					return True
			return False
		
	def write(self, key, value, safe = False):
		#Safe mode ensures the existence of the key, used to create the default config
		#Value == None behavior is undefined in safe mode, nothing is changed
		#Safe == False is normal override behavior
		with open(self.main_config, "r+") as f:
			with self.create_file() as temp:
				append = True
				for line in f:
					line = self._unify(line)
					if line.split("=")[0] != key:
						temp.write(line + "\n")
					else:
						append = False
						if value is not None and not safe:
							temp.write(key + "=" + value + "\n")
						else:
							continue
				if append:
					if value is not None:
						temp.write(key + "=" + value + "\n")
				f.flush()
				temp.flush()
				f.truncate(0)
				f.seek(0)
				temp.seek(0)
				for line in temp:
					f.write(line)
				f.flush()
		self._delete_temp_files()
		
	def write_flag(self, flag: str, value: bool):
		with open(self.main_config, "r+") as f:
			with self.create_file() as temp:
				append = value
				for line in f:
					if line.startswith("#"):
						line = self._unify(line)
						if flag == line:
							if value:
								temp.write(line + "\n")
								append = False
							else:
								continue
						else:
							temp.write(line + "\n")
				if append:
					temp.write("#" + flag.lstrip("#") + "\n")
				
				f.flush()
				temp.flush()
				f.truncate(0)
				f.seek(0)
				temp.seek(0)
				for line in temp:
					f.write(line)
				f.flush()
		self._delete_temp_files()
	
	def __init__(self, config_name = "config", config_path = os.getcwd()):
		if not config_name.endswith(".ini"):
			config_name += ".ini"
		self.config_name = config_name
		self.main_path = self._resolve(config_path)
		self.main_config = os.path.join(self.main_path, self.config_name)
