def default_config():
	ini.write(usb_scan_period, "5", safe=True)
	ini.write(tcp_caching, "true", safe=True)
	ini.write(tcp_cache_scan_period, "60", safe=True)
	ini.write(auto_tcp, "true", safe=True)
	ini.write(auto_mtp, "true", safe=True)
	
